var tipuesearch = {"pages": [{'title': 'First', 'text': '', 'tags': '', 'url': 'First.html'}, {'title': 'About', 'text': 'stud2:  https://stud2.cycu.org:8072', 'tags': '', 'url': 'About.html'}, {'title': 'cmsimde_site', 'text': 'https://www.asjh.ntpc.edu.tw/p/406-1000-3359,r24.php \n IG \n The_Oxford_5000.pdf \n cambridge_english_vocabulary_list.pdf \n', 'tags': '', 'url': 'cmsimde_site.html'}, {'title': 'GTP', 'text': 'Q: 要如何用github寫網頁 \n \n Q:幫我寫一個紅綠燈的程式 \n \n ANS: \n \n Q: 三角函數的定義 \n \n ANS: \n \n', 'tags': '', 'url': 'GTP.html'}, {'title': '托福', 'text': 'TOEFL \xa0 iBT測驗包含四個部分，考生必須在3個小時內完成全部測驗。 閱讀測驗–評量考生在大學校園求學時，閱讀課堂上的教材及文章之理解能力。 聽力測驗–評量考生在大學校園中，對英語的口語聽力理解能力。 口說測驗–評量考生在大學校園的學術環境下、使用英語進行口語表達的能力。 \n \n \n \n', 'tags': '', 'url': '托福.html'}, {'title': 'Gre', 'text': '由私立的 美國教育考試服務中心 （ ETS ）主辦的標準化 考試 ，用來測驗大學畢業生的知識技能掌握情況。 [1] 在很多英語國家特別是 美國 ，GRE成績被作為 研究生 錄取的標準之一。如今在歐洲，亞太地區也有越來越多的大學，如德國，香港，新加坡的大學，把GRE作為英語授課課程錄取標準之一。1949年，ETS創辦、並執行考試任務， [2] 旨在檢測學生在長時間學習過程中積累的詞彙、數量分析、分析性寫作、批判性思維，但並不特定某一專業領域。GRE考試由合格的測試中心主持提供機考。 \n GRE 成績在研究生院錄取當中的重要程度視院校與情況的不同而不同。有時， GRE 成績只作為參考使用，有時則是選拔的關鍵指標。 GRE 在2011年8月進行了改版，導致考試不僅僅是依據考題作為回答基礎，而且具有選擇性，即在回答詞彙和數學第一部分的情況會決定第二部分的難度。從總體上來看，考試維持了老版的許多形式，但是成績尺度由200-800改為了130-170。考試費用依據開考國家的不同由 US$ 130到$210不等， ETS 會在某些特定的情況下進行費用的減免，並向貧困生提供助學金。 [3] 雖然一些院校接受超過5年以上的成績，但是ETS在滿5年就不再發放成績單了。 \n GRE考試分兩部分： 普通 （ General ）和 專項 （ Subject ）。在美國，報考研究生經常需要遞交普通GRE考試成績。很多專業因為沒有合適的GRE專科考試而不要求此項成績。 \n \n', 'tags': '', 'url': 'Gre.html'}, {'title': '多益', 'text': 'Test of English for International Communication 簡稱為「 TOEIC多益 測驗 」 。 \n TOEIC 測驗是針對非英語母語人士，來設計的英語能力檢定測驗，測驗分數反映受測者在國際職場環境中與他人以英語溝通的熟稔程度。 \n 多益考試 是 以職場為基準點的英語能力測驗 中，目前世界最頂級的考試，全球有超過四千家企業使用多益測驗，每年有超過200萬人應試。熱門證照排行榜中，TOEIC 多益測驗國際溝通英語測驗名列第二，僅次於美國公認會計師 CPA，而台灣近年來因應國際化之趨勢，參加TOEIC多益測驗人數不斷增加。 \n \xa0', 'tags': '', 'url': '多益.html'}]};